utside the US.  NO New York City. Shoppers please note that the magazine is not included in this listing, only the adapter. This listing is for  THREE  grip adapters assemblies. Hit Buy it, and youre buying 3, and not one. This does NOT include any magazine. We have magazine photos to assist with assembly. Buyers, however, may take any number of extras at the same per-assembly price and with no additional shipping charges. Here is a piece we installed a lot of back in the 1980s and early 1990s, Precision Gun Specialties grip adapter that makes a full size 5906 or 5900 type Smith  Wesson magazine fit the venerable 6906 or 6900 type Smith  Wesson Metal Frame Compact 9mms; they work perfectly on the older 469 and 669 Mini SWs as well. These will also fit the current production fifteen round Mec-Gar magazines numbers SW5915B and SW5915N. They will NOT work for Mec-Gar numbers 5910 and 5917, however. The tail pieces are different from the factory mags on the tens and seventeen rounders made by Mec-Gar, but the Mec-Gar fifteens are the same as the factory Smith  Wessons. No One regards the 6900 Smith  Wessons more highly than we do, but their compactness renders them less than ergonomic for protracted firing sessions, especially for folks like some of us with hands like Gatemouth Browns. These outfits have always been popular with law enforcement officers who carry them for backup in tactical situations, like drug agents who use the full capacity 6906 6946 type compacts and then have larger, but good feeling extra magazines. The adapters themselves are still manufactured by our old friends at Precision Gun Specialties; and they are relatively easy to install. We just remove the floorplate, install the adapter sleeve, and then slide in the PGS replacement floorplate. These adapters also work on 4000 series magazines, 4006 and 4003 mags, to fit into some variants of the 4013TSW and similar; the .40 compacts, though, have to be the ones capable of accepting double stacked magazines, not the single stacked ones like the old 4013 variants. Its literally just a snap to put one of these on the longer magazines. Single adapter price is $25.00. Were offering the adapters separately, however, in lots of 3 or more at only $19 each. Own 3 for only $ 57.00", "Mounts4322": "Grips - Pistol", "Price4546": "57.00", "0077": "Lot of 3 Magazine Grip Adapters Smith & Wesson 5906 Magazine to 6906 Guns General Precision Black Polymer Puts Big 59 Mags onto Models 469 669 6904 69", "Phone4225": "731 989 7641", "Categories4043": "Gun Parts & Accessories", "International6625": "node1", "Fax4229": "731 989 4723"}
