{"Accessories4054": "Art", "Fax4456": "", "Accepted4257": "Personal Check, Cashiers Check, USPS Money Order", "file_name": "ADF77A4B8F201C641EF65E9CA8863D4BCC45933A932F36BB8184A6F0C7893539.html", "International4179": "100571212", "Listings4236": "172", "Top6679": "clear=\"all\">      Privacy Policy  -  User Agreement  -  FAQs  -  Contact Us           2006 - 2015 all rights reserved. | Guns International.com cc 1                         Close    Tell a Friend About Us                     $(function(){ $(\"#header_tell_friend_form\").submit(function(){ dataString = $(\"#header_tell_friend_form\").serialize(); $.ajax({ type: \"POST\", url: \"//www.gunsinternational.com/functions/tell_friend_contact.cfm?act=send\", data: dataString, dataType: \"json\", success: function(data) { if(data.error_contact_detail == false){ $(\"#header_tell_friend_target_div\").load(\"//www.gunsinternational.com/functions/tell_friend_contact.cfm?act=fin\"); } else { $(\"#header_tell_friend_target_div\").load(\"//www.gunsinternational.com/functions/tell_friend_contact.cfm?act=load\"); } } }); return false; }); }); $('#header_tell_friend').on('show.bs.modal', function (event) { $(\"#header_tell_friend_target_div\").load(\"//www.gunsinternational.com/functions/tell_friend_contact.cfm?act=load\"); });           function do_want() { var get_vars = document.location.search; if(get_vars.search(\"contact_error\") > 0){ $( \"#contact_btn\" ).trigger( \"click\" ); load_captcha(); } };", "Price4278": "6,500.00", "Since4201": "2/25/15", "Name4205": "Jaco", "Seller4245": "Private Seller", "Name4209": "Hranowskyj", "9864184": "- Art Civil War Collectibles", "Seller4181": "", "Company4197": "", "State4214": "Virgini", "Listings4241": "203", "On6622": "2015", "Zip4218": "22611", "Seller4193": "Jacob Hranowskyj", "guns4252": "", "Description4273": " A fine original oil painting on canvas of Captain John Lewis Brooke MD CSA 13th Va. Regiment Co. D Louisa Blues. Painted in 1905 from a daugerotype photograph by Willis Pepoon. The actual painting measures 30 inches tall and 25 inches wide. The outside frame dimesions are 36 1/4 inches by 31 1/4 inches. The original photograph was taken the morning after the battle of Winchester, Va. July 1862. The painting remains in fine condition with no repairs or restoration. Capt. Brooke was a doctor for the 13th Va. Infantry Regiment. He was born in 1824 and died in 1869. The painting depicts Capt. Brooke in a relaxed pose in his Confederate uniform. His CSA buckle and buttons are easily identified in the painting. This painting was most likely commisioned by a family member in 1905. The 13th Va. Louisa Blues was part of the 16th Va. Cavalry as its nucleus... with prominent commanders of Colonels George A. Goodman, Ambrose P. Hill, James B. Terrill, James A. Walker and Majors Charles T. Crittenden and John B. Sherrard... Brigades of the Army of Northern Va. They were present and fought at the battles of First Manassas, Jacksons Valley Campaign, Seven Days, Cold Harbor, Cedar Mountain, Cross Keys, Port Republic, Gaines Mill, Second Manassas, Fredericksburg, Chancellorsville, Winchester, Cedar Creek among many others. The Volunteer force was gathered in 1861 commisioned at Harpers Ferry and comprised of men mainly from Winchester, Louisa, Culpeper and Hampshire Counties of Virginia. His father was also a doctor and previous family were from Fauquier County and Culpeper. There is a wealth of information online of the 13th Va. Regiment. Willis Pepoon was a noted American artist/painter born 1859 died 1940 and a Washington DC native and was most known for his commisioned portraits. Paintings of his are in Museums including the Smithsonian, College of William  Mary, VMI. A fine historical painting with Confederate provenance. USPS priority shipping crated and boxed is 100.00     Price:  $6,500.00                     .detail_img_t { margin-bottom:4px;}   Click Photo to Enlarge                                              Guns International #: